import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import { issueAPI } from '../../services/api';
import '../../assets/styles/dashboard.css';

const Dashboard = () => {
  const { user } = useAuth();
  const [issues, setIssues] = useState([]);
  const [stats, setStats] = useState({ total: 0, pending: 0, inProgress: 0, resolved: 0 });

  useEffect(() => {
    loadIssues();
  }, []);

  const loadIssues = async () => {
    const response = await issueAPI.getIssuesByCitizen(user.id);
    const userIssues = response.data;
    setIssues(userIssues);
    setStats({
      total: userIssues.length,
      pending: userIssues.filter(i => i.status === 'Pending').length,
      inProgress: userIssues.filter(i => i.status === 'In Progress').length,
      resolved: userIssues.filter(i => i.status === 'Resolved').length
    });
  };

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1 className="dashboard-title">Citizen Dashboard</h1>
        <p className="dashboard-subtitle">Welcome back, {user.name}!</p>
      </div>
      <div className="stats-grid">
        <div className="stat-card total"><div className="stat-label">Total Issues</div><div className="stat-value">{stats.total}</div></div>
        <div className="stat-card pending"><div className="stat-label">Pending</div><div className="stat-value">{stats.pending}</div></div>
        <div className="stat-card in-progress"><div className="stat-label">In Progress</div><div className="stat-value">{stats.inProgress}</div></div>
        <div className="stat-card resolved"><div className="stat-label">Resolved</div><div className="stat-value">{stats.resolved}</div></div>
      </div>
      <div style={{ marginBottom: '2rem' }}><Link to="/citizen/report" className="btn btn-primary">Report New Issue</Link></div>
      <div className="card">
        <h2 className="card-header">Recent Issues</h2>
        {issues.length === 0 ? (
          <div className="empty-state"><div className="empty-state-icon">ðŸ“‹</div><p className="empty-state-text">No issues reported yet</p></div>
        ) : (
          <div className="table-container">
            <table className="table">
              <thead><tr><th>Category</th><th>Description</th><th>Location</th><th>Status</th><th>Date</th></tr></thead>
              <tbody>
                {issues.slice(0, 5).map(issue => (
                  <tr key={issue.id}>
                    <td>{issue.category}</td>
                    <td>{issue.description.substring(0, 50)}...</td>
                    <td>{issue.location}</td>
                    <td><span className={`status-badge status-${issue.status.toLowerCase().replace(' ', '-')}`}>{issue.status}</span></td>
                    <td>{issue.createdAt}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
